var value;

for(var i=1;i<b.length-1;i++){
  var temp="";
  if(i<b.length-2)
  {
    temp=b[i];
    var j;
    for(j=temp.length-1;j>0;j--){
      if(temp[j]==",")
      break;
    }
    value=temp.slice(0,j);
    if(value[0]=="["){
      value=value;
    }
      obj[key.slice(1)]=value

    key=temp.slice(j+1);
  }
  else if(i==b.length-1){
    value=b[i]
      obj[key.slice(1)]=value
    key=temp.slice(j+1);
  }
}
var pattern = /\b(\w+)\s*\=\s*\[(.*?)\]/g;
var matches = [];
while ((match = pattern.exec(str)) != null) {
  matches.push(match);
}

var result = {};

matches.forEach(function(match) {
  var key = match[1];
  var value = match[2];
  result[key] = ("[" + value + "]");
});
var res=result.fund.toString().replaceAll("=",":") +"";

outputs.funds=toConvertToJSON(res).toString();
outputs.response=(obj);
})(inputs, outputs);

function toConvertToJSON(fund){
  var array=[];
var str="";
var bool =false;
var obj={};
for(var i =0;i<=fund.length;i++){

    if(fund[i]=="{"){
        bool =true;
    }
    else if(fund[i]=="}"){
        bool =false;
        var arr=str.split(", ");
        arr.forEach(function(element){
            gs.addErrorMessage(element)
            var ele = element.split(":");
                obj[ele[0]]=ele[1];
        })
        array.push(obj);
        str="";
        obj={};
    }
    else if(bool){
        str=str+fund[i];
    }
}
return(JSON.stringify(array));
}

